import React from "react";
import Navbar from "../components/Navbar";
import TeamImg from "../assets/team.jpg"; 

function Team() {
  return (
    <>
      <Navbar />
      <h1 style={{ textAlign: 'center', color: '#632020' }}>About us</h1>
      <p>Our team is full of passionate people and ready to make your dream software come true</p> {/* Replaced "text" with "p" for the paragraph */}
      <div className="App">
      <img src={TeamImg} alt="Team" height="50%" width="50%" style={{alignSelf: 'left'}} />

      </div>
    </>
  );
}

export default Team;
